import React from 'react';

 
const Calculator = () => (  
  <div>
    <iframe className="calendar" width="585" height="364" src="https://freeserv.dukascopy.com/2.0/?path=position_size_calculator/index&amp;showHeader=false&amp;showFooter=false&amp;accentColor=%23000000&amp;availableInstruments=l%3A&amp;instrument=EUR/USD&amp;accountCurrency=USD&amp;accountBalance=1000&amp;stopLossPips=50&amp;riskUnit=1&amp;riskPercentage=2&amp;width=585&amp;height=364&amp;adv=popup" 
    border="0" marginwidth="0" marginheight="0"
     frameborder="0" scrolling="no"/>
  </div>
);
export default Calculator;
